import React, {Component, useState} from 'react';
import Navigation from '../components/Navigation';
import ToggleSwitch from '../components/ToggleSwitch'
import Footer from '../components/Footer';


class AddNew extends Component {
  render() {
  const [viewSettings, setViewSettings] = useState(false);
  const [savePassword, setSavePassword] = useState(false);
  const [useLower, setUseLower] = useState(true);
  const [useUpper, setUseUpper] = useState(true);
  const [useNumber, setUseNumber] = useState(true);
  const [useChar, setUseChar] = useState(true);

  return (
    <div>
      <Navigation />
      <body className="main-content">
        <h2>Generate New Passwword</h2>
        <form className="add-new-form">
          <ToggleSwitch
            name="View Settings"
            checked={viewSettings}
            onChange = {() => setViewSettings(!viewSettings)}/>
          <div className='toggle-label'>
            <p>View Settings</p>   
          </div>         
          <div className="toggle-container">
          <ToggleSwitch 
            isToggled={savePassword}
            onToggle = {() => setSavePassword(!savePassword)}/>
            <p className="toggle-label">Allow Saving</p>   
          </div>
        </form>
      </body>
      <Footer />  
    </div>
  );
};
};
export default AddNew
